class App extends Component {
  render() {
    return (
      <div className="App">
       <Counter by="10"></Counter>
       <Counter by="5"></Counter>
       <Counter by="1"></Counter>
      </div>
    );
  }
}

class LearningExamples extends Component{
  render() {
    return (
      <div className="App">
        Hello harsh
        <FirstComponent/>
        <SecondComponent/>
      </div>
    );
  }
}
export default App;
